noAxe=true;
vitMesh2=1/25;// sa période de rotation est de 25j !
var mesh,image,imageEris;
var nImage=0;
var distSol=1.01e10;

function avanceImage() {
	nImage++;
	if (nImage>1) {
		//terre
		geometry = new THREE.SphereGeometry( 250, 32,32 );
		var texture = new THREE.Texture( image );
		texture.needsUpdate = true;
		var material2 = new THREE.MeshPhongMaterial({
			map: texture,
			shininess: 4
		  });
		  
		var bufferGeometry = new THREE.BufferGeometry().fromGeometry( geometry);  
		mesh = new THREE.Mesh( bufferGeometry, material2 );
		mesh.position.x=-200;
		mesh.castShadow = true;
		mesh.rotation.order = "XZY";
		
		scene.add( mesh );
		// Eris
		geometry = new THREE.SphereGeometry( Math.round(250*0.17), 32,32 );
		var texture = new THREE.Texture( imageEris );
		texture.needsUpdate = true;
		var material2 = new THREE.MeshPhongMaterial({
			//map 
			map: texture,
			shininess: 4
		});
		var bufferGeometry = new THREE.BufferGeometry().fromGeometry( geometry);  
		mesh2 = new THREE.Mesh( bufferGeometry, material2 );
		mesh2.rotation.order = "XZY";
		scene.add( mesh2 );
		mesh2.position.x=200;
		
		//special Eris
		document.getElementById("divlegende1").style.left=xFen+hGL*0.2+"px";
		document.getElementById("divlegende2").style.left=xFen+hGL*0.68+"px";
		document.getElementById("divlegende1").style.top=yFen+"px";
		document.getElementById("divlegende2").style.top=yFen+hGL*0.2+"px";
		document.getElementById("divlegende2").style.display="block";
		document.getElementById("divlegende1").style.display="block";
		animate();		
	}
}

function init_planete(){
    
	image = document.createElement( 'img' );
	image.onload = function () {
		avanceImage();
	}
	image.src='data:image/jpg;base64,' ;

	
	imageEris = document.createElement( 'img' );
	imageEris.onload = function () {
		avanceImage();
	}
	imageEris.src='data:image/jpg;base64,' ;
}

